import React from 'react'

class Login extends React.Component{

    render(){
        return <div>
            <form>
                <label>UserName</label>
                <input type={"Text"} id={"username"}/>
                <label>Password</label>
                <input type={"Password"} id={"password"}/>
            </form>
        </div>
    }

}

export default Login;
